gql_query:
query ($running_job_instance_id: String = JbY4_9) {
    JobInstance(filter: {
        instance_id_contains: $running_job_instance_id
    }, first: 25, offset: 0) {
        instance_id
        start_time
        description
        job_name
        status
        group_name
        uniqueId
        project_id
        Job_JobInstance {
            name
            description
            uniqueId
            project_id
        }

        JobInstance_Group {
            name
            description
            uniqueId
            project_id
        }

    }
}
